import './Intro.css'

interface Props {

}

const Intro: React.FC = () => {
    return (
        <div id="about">
            <h2>ABOUT ME</h2>
            <Row gutter={16} className="details">
                <Col span={8} offset={4}>
                    <Image
                        className="profile"
                        width={200}
                        src={introImage}
                    />
                </Col>
                <Col span={8} className="details">
                    <h5>안녕하세요 <strong>이동영</strong> 입니다.</h5>
                    <br />
                        동영이가 훈련소에 들어갔습니다.

                    <br />
                    <br /><br />
                </Col>
            </Row>
            <br /><br />
        </div>
    )
}

export default Intro;
